import React, { Component } from 'react';
import './Regular.css';
import ProjectItem from './ProjectItem.js';





export default class Projects extends React.Component {
	constructor(props) {
		super(props);
	}


	render() {
		this.props.items.forEach(function(obj) { console.log(obj.id); });
		const dataList = Object.entries(this.props.items).map(([id, title, info]) => (
			<div><ProjectItem projectTitle={title}
					projectInfo={info}
					></ProjectItem><br/></div>
			)
		);

	    return (
			<p id="projects_content">
			</p>
	);
	}
}
